public static class PasswordValidator
{
    public static int ValidatePasswords1(string rows)
    {
        var passwordRows = ParseData(rows);
        return passwordRows.Count(x =>
        {
            var chars = x.Password.Count(p => p == x.PasswordPolicy.Char);
            return chars >= x.PasswordPolicy.Val1 && chars <= x.PasswordPolicy.Val2;
        });
    }

    private static IEnumerable<PasswordRow> ParseData(string rows)
    {
        var matchCollection = Regex.Matches(rows,
            @"^(?<min>\d+)-(?<max>\d+) (?<char>\w): (?<password>.+)$",
            RegexOptions.Multiline);

        return matchCollection.Select(x =>
            new PasswordRow(
                new PasswordPolicy(
                    int.Parse(x.Groups["min"].Value), int.Parse(x.Groups["max"].Value), x.Groups["char"].Value[0]),
                x.Groups["password"].Value));
    }

    public static int ValidatePasswords2(string rows)
    {
        var passwordRows = ParseData(rows);
        return passwordRows.Count(x =>
        {
            var validPoss1 = x.Password[x.PasswordPolicy.Val1 - 1] == x.PasswordPolicy.Char;
            var validPoss2 = x.Password[x.PasswordPolicy.Val2 - 1] == x.PasswordPolicy.Char;
            return validPoss1 ^ validPoss2;
        });
    }

    record PasswordPolicy(int Val1, int Val2, char Char);

    record PasswordRow(PasswordPolicy PasswordPolicy, string Password);
}